import React from "react";
import "./App.css";
import TodoList from "./components/TodoItem";

class App extends React.Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div>
        <TodoList title="Get to work" />
        <TodoList title="Go home" />
        <TodoList title="Self study at home" />
      </div>
    );
  }
}

export default App;
